function typeWriter(t) {
    const e = t.innerHTML.split("");
    t.innerHTML = "", e.forEach((e, n) => { setTimeout(() => { t.innerHTML += e }, 100 * n) })
}! function() { "use strict"; const t = document.getElementsByClassName("typewriter"); for (var e of t) typeWriter(e) }();